import React from "react";
import ReactDOM from "react-dom";

function Card(props) {
  return (
    <div>
      <h2>{props.name}</h2>
      <img
        src={props.img}
        alt="avatar_img"
      />
      <p>{props.tel}</p>
      <p>{props.email}</p>
    </div>
  );
}

ReactDOM.render(
  <div>
  <h1>Contacts</h1>
  <Card  name="girl"  img="https://www.google.com/imgres?imgurl=https%3A%2F%2Fm.media-amazon.com%2Fimages%2FI%2F61Krpl7FGyL._SL1500_.jpg&imgrefurl=https%3A%2F%2Fwww.amazon.in%2FCello-Venice-Plastic-Bottle-Assorted%2Fdp%2FB07BFBNFSF&tbnid=6V-Tj_xzKuqtSM&vet=12ahUKEwip9dvxsMT6AhUJi9gFHXLVC_gQMygAegUIARDjAQ..i&docid=U9_9peG29MO6DM&w=1500&h=1500&q=bottle%20images&ved=2ahUKEwip9dvxsMT6AhUJi9gFHXLVC_gQMygAegUIARDjAQ"  tel="123"
  email="beonc.in"


  />
  </div>,
  document.getElementById("root")
);
